window.fontLoader = () => {
	if (window.bwipjs.loadFont) {
		let start = performance.now();

		const fonts = [
			[
				`OCR-A`,
				`OCR-A`,
				``
			],

			[
				`OCR-B`,
				`OCR-B`,
				``
			],

			[
				`CASIOFX-702P`,
				`CASIOFX-702P`,
				``
			],

			[
				`CONSOLEPIXEL`,
				`CONSOLEPIXEL`,
				``
			],

			[
				`Inconsolata`,
				`Inconsolata`,
				``
			],

			[
				`Text-Me-One`,
				`Text Me One`,
				``
			],

			[
				`Return-of-Ganon`,
				`Return of Ganon`,
				``
			],

			[
				`ShockingHeadline`,
				`Shocking Headline`,
				``
			],

			[
				`FTYDeliriumNCV`,
				`FTY Delirium NCV`,
				``
			],

			[
				`XenophobiaNominal`,
				`Xenophobia Nominal`,
				``
			],

			[
				`Promenade`,
				`Promenade de la Croisette`,
				``
			]
		];

		let fontOptions = document.getElementById('barcodeTextFontType');
		for (const [fontName, fontFullName, fontData] of fonts) {
			window.bwipjs.loadFont(fontName, fontData);
			fontOptions.append(Object.assign(document.createElement('option'), {
				value: fontName,
				textContent: fontFullName,
			}));
		}

		window.writeToLog(`Fonts loaded in ${(performance.now() - start).toFixed(3)}ms`);
		clearInterval(window.fontLoaderLoop);
		window.writeToLog("cleared font loader");
		document.getElementById('render').disabled = false;
		window.fontLoadComplete = true;
	} else { window.writeToLog("fontLoader hook not fully initialized - relooping."); }
};
